                                    path={val.tyre_path}
                                    name={val.name}
                                    code={val.idoffer}
                                    data={val.data}
                                    price={val.price}
                                />
                            </>
                        );
                    })}
                    </ul>
                </div>
            </div>
        </div>
    )
}

